import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Shopping from './ShoppingList'
import Game from './Game'
import Game2 from './Game2'
import WelcomeApp from './WelcomeApp'
import ActionEvent from './EventHandle'
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<Game2/>, document.getElementById('root'));

ReactDOM.render(<WelcomeApp/>, document.getElementById('app2'));

ReactDOM.render(<ActionEvent/>, document.getElementById('app3'));
// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
